      <h2>Contact Me</h2>
      <p>Email: usman.nja.14@gmail.com</p>
      <p>LinkedIn: https://www.linkedin.com/in/usman-qureshi-2a0631149/</p>
      <p>Cell Number: 616-334-9660</p>
    </section>
    </footer>

  );
}

export default Contact;
